import React, {Component} from 'react'

import '../checkbox.css'

class Checkbox extends Component {
    render(){
        return (
            <span onClick={this.props.toggleCheck} onChange={this.props.onChange()}>
                <input type="checkbox" checked={this.props.isChecked} onChange={this.props.onChange}></input>
                <span></span>
            </span>
        )
    }
}

export default Checkbox
